import React, { Component } from 'react';

/* Syles */

const catDivStyle = {
  display: 'grid',
  // padding: '100px',
  // height: '900px'
  borderRight: '1px solid gray',
  borderLeft: '1px solid white',
  borderBottom: '1px solid white'
};

const pCatStyle = {
  fontFamily: 'Geneva',
  fontSize: '16px',
  textAlign: 'center',
  color: 'gray'
};

const progressCardStyles = {
  display: 'grid',
  padding: '10px',
  backgroundColor: 'lime',
  border: '2px solid black',
  borderRadius: '10px'
};

const items = {
  borderRadius: '10px'
};


/* End Syles */


class inProgress extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
          {
            id: 1,
            description: 'Make Better Styles.',
            priority: 'Medium',
            by: 'Jon',
            to: 'Renee'
          },
          {
            id: 2,
            description: 'Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles.',
            priority: 'Medium',
            by: 'Jon',
            to: 'Renee'
          }
      ]
    }
  }

  render() {    
    const Section = () => (
        <div style={catDivStyle}>
        <p style={pCatStyle}>IN PROGRESS</p>  
        <div style={{padding: '40px'}}>
          <div style={progressCardStyles}>
              {this.state.items.map( item => <p>{item.description}</p> )}
              {this.state.items.map( item => <p>{item.priority}</p> )}
              {this.state.items.map( item => <p>{item.by}</p> )}
              {this.state.items.map( item => <p>{item.to}</p> )}
          </div>
        </div>
        </div>
    );


    return (
      <div>
          <Section />
      </div>
    );
  }
}



export default inProgress;
